import React from 'react'
import { Container, Jumbotron } from 'react-bootstrap';

function Pickup(props) {
    return (
        <div>
            <Container>
                <h5>Prices</h5>
                <ul>
                    <li>
                    $40 per Kayak
                    </li>
                    <li>
                    $40 per Canoe
                    </li>
                </ul>
            </Container>
        </div>
    )
}

export default Pickup;
